import React, {useState} from 'react';
import logo from './logo.svg';
import CarouselOfProjects from './components/CarouselOfProjects';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import ModalContent from './components/ModalContent';




function App() {

	const [modalContentToShow, setModalContentToShow] = useState(
		{
			tensorflow: false,
			arraySort:false,
			custom:false
		}
	);

	function showModal(name:string){
		console.log("MODAL SHOW");
		switch (name){
		case 'tensorflow':
			setModalContentToShow({tensorflow: true,arraySort: false,custom: false});
			break;
		case 'arraySort':
			setModalContentToShow({tensorflow: false,arraySort: true,custom: false});
			break;
		case 'custom':
			setModalContentToShow({tensorflow: false,arraySort: false,custom: true});
			break;
		}

	}


	return (
		<div className="App">
			{/*<ModalContent data={closeTf}/>*/}
			<CarouselOfProjects modalshow={showModal}/>
		</div>
	);
}

export default App;
